import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';


let dialogsData =[
  {id: 1, name: "Dima"},
  {id: 2, name: "Ilyas"},
  {id: 3, name: "Vanya"},
  {id: 4, name: "Sasha"},
  {id: 5, name: "Maximilian"}
];

let messagesData =[
  {id: 1, messages: "Hi"},
  {id: 2, messages: "How are you?"},
  {id: 3, messages: "What is your name?"},
];

let Posts =[
  {id: 1, messages: "Hi, how are you", likesCount: 15},
  {id: 2,messages: "it's my first post",likesCount: 20},
];

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App Posts={Posts} dialogsData={dialogsData} messagesData={messagesData}/>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
